import React, { Component } from 'react'
import USChart from '../Charts/UnitedStatesCases'
import IndiaChart from '../Charts/IndiaCases'
import IndiaButton from './IndiaButton'
import USButton from './USButton'

class Home extends Component() {

    render() {
        return (
            <div>
                <button type="button" class="btn btn-outline-primary" onClick={ showIndia() }>India</button>
                <IndiaButton />
            </div>
        )
    }

    showIndia() {
        return (
            <IndiaChart />
        )
    }

}

export default Home;
